import axios from "axios";


export default class PostService {
   static async getLists() {
      try {
         const response = await axios.get('https://62c6bbd02b03e73a58d57240.mockapi.io/lists')
         .then(resp => resp)
         console.log(response.data)
         return response
      } catch {
         return []
      }

   }
}
